import React, { useEffect, useRef } from 'react';
import VanillaTilt from 'vanilla-tilt';

import './Projects.css';
import link from "../../assets/symbols/link.svg";
import autoscore from "../../assets/symbols/autoscore.png";
import memegame from "../../assets/symbols/memegame.jpg";
import portfolio from "../../assets/symbols/portfolio.jpg";

const Projects = () => {
  const tiltRef = useRef([]);

  useEffect(() => {
    tiltRef.current.forEach(tilt => {
      VanillaTilt.init(tilt, {
        max: 25,
        speed: 400,
        glare: true,
        "max-glare": 0.5,
      });
    });

    return () => {
      tiltRef.current.forEach(tilt => tilt.vanillaTilt.destroy());
    };
  }, []);

  // Function to add elements to the ref array
  const addToRef = el => {
    if (el && !tiltRef.current.includes(el)) {
      tiltRef.current.push(el);
    }
  };

  return (
    <section id='Body'>

      <div class="maxwidth-60 margin-title">
        <h1 class='title'>Projects</h1>
        <h1 class="paragraph">
          Here are a few personal projects.
        </h1>
      </div>

     <section class="Projects_Container">

        <div class="Project_items one">

          <h1 class="project_title" >AutoScore</h1>
          <img class="project_image" src={autoscore}></img>
          <p class="project_description" >This project aids teaching assistance by automating the process of grading assignments for a Java course, marking the code, and seamlessly submitting the grades to MyLearningSpace.</p>

          <div class="project_skills">
            <span>#JFrames</span>
            <span>#AbstractSyntaxTrees</span>
            <span>#JUnitTesting</span>
            <span>#Aglie</span>

          </div>

          <div class="buttons_container">
            <a class="github_link" href="https://github.com/kevinyejoonlee/AutoScore">
              <img class="linkImg" src={link} alt=""></img>
              <span>github/autoscore</span>
            </a>
          </div>


        </div>

        <div class="Project_items two">


          <h1 class="project_title" >Meme-Memory</h1>
          <img class="project_image" src={memegame}></img>
          <p class="project_description" >Meme-Memory is an innovative and fun memory game that combines the classic challenge of "Simon Says" with the vibrant culture of internet memes.</p>

          <div class="project_skills">
              <span>#jQuery</span>
              <span>#HTML</span>
              <span>#CSS</span>

          </div>

          <div class="buttons_container">
            <a href="https://kevinyejoonlee.github.io/Meme-Memory-Game/" class="button see_live">See Live</a>

            <a class="github_link" href="https://github.com/kevinyejoonlee/Meme-Memory-Game">
              <img class="linkImg" src={link} alt=""></img>
              <span>github/MemeGame</span>
            </a>
          </div>
        </div>

        <div class="Project_items three">
            <h1 class="project_title">Portfolio Website</h1>
            <img class="project_image" src={portfolio}></img>
            <p class="project_description" >

            Developed a portfolio web application tailored to showcase professional and creative work in a visually engaging and organized manner. Inspired by Tailwind UI Spotlight. </p>

            <div class="project_skills">
              <span>#React.js</span>
              <span>#Node.js</span>
              <span>#Firebase</span>
              <span>#InspiredByTailwindUI</span>

            </div>

            <div class="buttons_container">
            <a href="" class="button see_live">See Live</a>

            <a class="github_link" href="https://github.com/kevinyejoonlee/to-do-list">
              <img class="linkImg" src={link} alt=""></img>
              <span>github/kevinPortfolio</span>
            </a>
            </div>
        </div>
      </section>

    </section>
  );
};

export default Projects;
